import { makeStyles } from '@material-ui/core';
import React from 'react';
import Election from 'components/Election';
import Navegation from 'components/Navegation';
import logoUNI from 'images/UNI_logo.png';
import './../css/fonts.css';

const useStyles = makeStyles(()=>({
  search:{
    display:'flex',
    flexDirection:'column',
    width:'100%',
    margin:'80px 0 0 85px',
    padding:'25px 0 0 60px',
    "& *":{
      fontFamily: 'Rubik, sans-serif'
    }
  },
  info:{
    "& strong":{
      color:'#A72C2C'
    }
  },
  electionTitle:{
    margin:'15px 0 0',
    padding:'1px 0 0 5px',
    borderLeft:'3px solid #5A2120'
  },
  electionsContainer:{
    display:'flex',
    flexDirection:'row',
    justifyContent:'space-between',
    margin:'30px 0 0',
    width:'80%'
  },
  elections:{

    width:'40%',
    display:'flex',
    flexDirection:'row',
    flexWrap:'wrap',
    justifyContent:'center',
    "& div":{
      margin:'10px',

      
    }
  },
  imgCont:{
    width:'400px',
    "& img":{
      width:"100%",
      opacity:'0.2'
    }
  }

}));

const Search = () => {
  const classes = useStyles();
  return (
    
      <div className={classes.search}>
          <Navegation />
          <div className={classes.searchTitle}> Bienvenido DIEGO </div>
          <div className={classes.info}>
            Informate sobre tus candidatos en las proximas elecciones
            para tener un <strong>VOTO CONSCIENTE</strong>
          </div>
          <div className={classes.electionTitle}>Usted participa en las siguientes elecciones</div>
          <div className={classes.electionsContainer}>
            <div className={classes.elections}>
              <div><Election text="ELECCIONES RECTORALES 2021" /></div>
              <div><Election text="ELECCIONES RECTORALES 2021" /></div>
              <div><Election text="ELECCIONES RECTORALES 2021" /></div>
              <div><Election text="ELECCIONES RECTORALES 2021" /></div>
            </div>
            <div className={classes.imgCont}>
              <img src={logoUNI} />
            </div>
          </div>
      </div>
    
  );
}

export default Search;
